"""
LeetCode
2147. Number of Ways to Divide a Long Corridor
November 2023 Challenge
jramaswami

Curr Seats   Curr Object   Go to
0            S             1
             P             0
1            S             2 or 0
             P             1
2            S             -
             P             2 or 0
"""


import functools


class Solution:
    def numberOfWays(self, corridor: str) -> int:
        MOD = pow(10, 9) + 7
        dp = [[0 for _ in range(3)] for _ in range(len(corridor)+1)]
        dp[0][0] = 1

        for i, row in enumerate(dp[:-1]):
            if corridor[i] == 'S':
                dp[i+1][1] += dp[i][0]
                dp[i+1][1] %= MOD
                dp[i+1][2] += dp[i][1]
                dp[i+1][2] %= MOD
                dp[i+1][0] += dp[i][1]
                dp[i+1][0] %= MOD
            else:
                dp[i+1][0] += dp[i][0]
                dp[i+1][0] %= MOD
                dp[i+1][1] += dp[i][1]
                dp[i+1][1] %= MOD
                dp[i+1][2] += dp[i][2]
                dp[i+1][2] %= MOD
                dp[i+1][0] += dp[i][2]
                dp[i+1][0] %= MOD
        return dp[-1][2]


def test_1():
    corridor = "SSPPSPS"
    expected = 3
    assert Solution().numberOfWays(corridor) == expected


def test_2():
    corridor = "PPSPSP"
    expected = 1
    assert Solution().numberOfWays(corridor) == expected


def test_3():
    corridor = "S"
    expected = 0
    assert Solution().numberOfWays(corridor) == expected


def test_4():
    "MLE"
    corridor = ""
    expected = 535364820
    assert Solution().numberOfWays(corridor) == expected